['class Node:

    def __init__(self, val=None):
        self.val = val
        self.next = None

class LinkedList:

    def __init__(self):
        self.head = None

    def add_at_end(self, val):
        new_node = Node(val)
        if self.head is None:
            self.head = new_node
            return
        current = self.head
        while current.next is not None:
            current = current.next
        current.next = new_node

    def reverse(self):
        prev = None
        current = self.head
        while current is not None:
            next_node = current.next
            current.next = prev
            prev = current
            current = next_node
        self.head = prev

def funcImp(head):
    ll = LinkedList()
    for i in head:
        ll.add_at_end(i)
    ll.reverse()
    return ll.head']

