class LinkedList:

    def __init__(self):
        self.head = None

    def insert(self, new_node):
        new_node.next = self.head
        self.head = new_node

    def reverse(self):
        prev, current, next = (None, self.head, None)
        while current is not None:
            next, current.next, prev, current = (current.next, prev, current, next)
        self.head = prev

def funcImp(head):
    ll = LinkedList()
    for val in head:
        ll.insert(Node(val))
    ll.reverse()
    return [node.val for node in ll]']

